/**
 * Dependencies
 */

import React, { useState, useEffect} from "react";

/**
 *  Import styles
 */

import  '../styles/navbar.scss'


/**
 * Define component
 */


function CarFixCard(props) {
    const [carFixes,setCarFixes] = useState([])

    useEffect(() => {
        async function fetchCars() {
            const res = await axiosWithAuth().get(`/car_fix/${props.car.id}`); 
            setCarFixes(res.data);
            console.log(res.data)
        }
        fetchCars()
    }, []);
    return (
      <>

      {carFixes.length < 1 ? <div>You have no Cars</div> :
              <Grid 

              item xs={12}
              sm={carFixes.length === 1 ? 12 : 12}
              md={carFixes.length === 1 ? 12 : 12}
              lg={carFixes.length === 1 ? 12 : 12} 
              container direction="row" justify="space-evenly">
                  {carFixes.map(c => {
                      return (
                        <>
                        <CarFixCard  key={caches.uid}  />
                        </>
                     );
                  })}
              </Grid>
            }
      </>
    );
};

/**
 * Export component
 */

export default CarFixCard;
